import SearchBar from "../SearchBar/SearchBar";
import style from "./Nav.module.css"
import { useState } from 'react'

const [characters,SetCharacters] = useState([]);

function Nav() {
    const [characters, setCharacters] = useState([]);
  
    const onSearch = (characterID) => {
      // Realizar una llamada a la API para obtener el personaje con el ID dado
      fetch(`https://api.example.com/characters/${characterID}`)
        .then(response => response.json())
        .then(data => {
          // Agregar el nuevo personaje al estado characters
          setCharacters(characters => [...characters, data]);
        })
        .catch(error => {
          console.error('Error al buscar personaje:', error);
        });
    };
}


export default function(props){
    return(
    <nav className={style.Nav}>
         <SearchBar onSearch={(characterID) => window.alert(characterID)} />
    </nav>
    );
}
